import classes from "./MainNavigation.module.css";

const MainNavigation = () => {
  return (
    <nav className={classes.header}>
      <p className={classes.logo}>Great Quotes</p>
      <ul>
        <li>
          <a href="#">All Quotes</a>
        </li>
        <li>
          <a href="#">Add a Quote</a>
        </li>
      </ul>
    </nav>
  );
};

export default MainNavigation;
